    string header_approved_status = 35 [json_name = "header_approved_status"]; // StatusItem
    string item_approved_status = 36 [json_name = "item_approved_status"]; // StatusItem
    string digital_item_approved_status = 37 [json_name = "digital_item_approved_status"]; // StatusItem
